syntax = "proto3";

package sekai.db;

import "sekai/db/proto/descriptor.proto";
message MysekaiFixtureMysekaiFixtureLabelRelation {
  option (master_db_file)                 = "mysekaiFixtureMysekaiFixtureLabelRelations.json";
  optional int32 id                       = 1 [(json_name) = "id"];
  optional int32 mysekai_fixture_id       = 2 [(json_name) = "mysekaiFixtureId"];
  optional int32 mysekai_fixture_label_id = 3 [(json_name) = "mysekaiFixtureLabelId"];
}
